import React from 'react';
import './header.scss';

const Header = () => {
    return (
        <div className="header">
            <nav className="navbar navbar-light">
                <a className="navbar-brand" href="#">
                    <div className="logo"><strong> [ </strong>Smart<strong>Code ]</strong></div>
                </a>
                <div className="links">
                    <button className="btn btn-danger">&#9776; Menu</button>
                </div>
            </nav>
        </div>
    )
}

export default Header;
